import { Component, EventEmitter, Input, Output } from "@angular/core";
import { CommonModule } from "@angular/common";
import { ButtonModule } from "primeng/button";

@Component({
  selector: "app-todo",
  standalone: true,
  imports: [CommonModule, ButtonModule],
  templateUrl: "./todo.component.html",
  styleUrls: ["./todo.component.scss"],
})
export class TodoComponent {
  @Input() todoData!: any;
  @Output() sendEmit = new EventEmitter<any>();

  sendData() {
    this.sendEmit.emit(this.todoData);
    console.log(this.todoData);
    console.log("Send");
  }
}
<div>
  <span><span>ID:</span> {{ todoData.id }}</span>
  <span>{{ todoData.title }}</span>
  <div>
    <p-button (click)="sendData()">Check</p-button>
    <p-button (click)="sendData()">Edit</p-button>
  </div>
</div>
